import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AddUser from './component/addUser';
import GetUser from './component/getUser';

function App() {
  return (
    <BrowserRouter>

      <Routes>
        <Route path="/" element={<AddUser />} />
        <Route path="/users" element={<GetUser />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
